description:
A normal couple, Jan and Debbie, are torn apart by a stalker; and just when Jan thinks it's all over, he's accused of a shocking crime.

U Be Dead  tells the true story of disturbed serial stalker Maria Marchese who was sentenced to 9 years in prison for the sustained intimidation of a London doctor, his family and even the lawyer who prosecuted her.

The Metropolitan Police called it &quot;one of the worst cases of stalking we have ever had to investigate&quot; and the drama is told with the help of the people who suffered at the hands of Marchese...

